PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE IF NOT EXISTS "django_migrations" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app" varchar(255) NOT NULL, "name" varchar(255) NOT NULL, "applied" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_content_type" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "app_label" varchar(100) NOT NULL, "model" varchar(100) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "auth_permission" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "content_type_id" integer NOT NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "codename" varchar(100) NOT NULL, "name" varchar(255) NOT NULL);
CREATE TABLE IF NOT EXISTS "auth_group" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "users_documenttype" ("documentTypeId" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "typeName" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "users_persontype" ("personTypeId" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "typeName" varchar(20) NOT NULL);
CREATE TABLE IF NOT EXISTS "users_customuser" ("password" varchar(128) NOT NULL, "last_login" datetime NULL, "is_superuser" bool NOT NULL, "is_staff" bool NOT NULL, "is_active" bool NOT NULL, "date_joined" datetime NOT NULL, "document" varchar(12) NOT NULL PRIMARY KEY, "first_name" varchar(50) NOT NULL, "last_name" varchar(50) NOT NULL, "email" varchar(254) NOT NULL UNIQUE, "phone" varchar(20) NOT NULL, "address" varchar(200) NOT NULL, "is_registered" bool NOT NULL, "document_type_id" integer NULL REFERENCES "users_documenttype" ("documentTypeId") DEFERRABLE INITIALLY DEFERRED, "person_type_id" integer NULL REFERENCES "users_persontype" ("personTypeId") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_customuser_groups" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" varchar(12) NOT NULL REFERENCES "users_customuser" ("document") DEFERRABLE INITIALLY DEFERRED, "group_id" integer NOT NULL REFERENCES "auth_group" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_customuser_user_permissions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "customuser_id" varchar(12) NOT NULL REFERENCES "users_customuser" ("document") DEFERRABLE INITIALLY DEFERRED, "permission_id" integer NOT NULL REFERENCES "auth_permission" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "users_loginhistory" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "timestamp" datetime NOT NULL, "user_id" varchar(12) NOT NULL REFERENCES "users_customuser" ("document") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "django_admin_log" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "object_id" text NULL, "object_repr" varchar(200) NOT NULL, "action_flag" smallint unsigned NOT NULL CHECK ("action_flag" >= 0), "change_message" text NOT NULL, "content_type_id" integer NULL REFERENCES "django_content_type" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" varchar(12) NOT NULL REFERENCES "users_customuser" ("document") DEFERRABLE INITIALLY DEFERRED, "action_time" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "users_otp" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "otp" varchar(6) NOT NULL UNIQUE, "creation_time" datetime NOT NULL, "user_id" varchar(12) NOT NULL REFERENCES "users_customuser" ("document") DEFERRABLE INITIALLY DEFERRED, "is_validated" bool NOT NULL, "is_login" bool NOT NULL);
CREATE TABLE IF NOT EXISTS "users_loginrestriction" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "attempts" integer NOT NULL, "blocked_until" datetime NULL, "last_attempt_time" datetime NULL, "user_id" varchar(12) NOT NULL REFERENCES "users_customuser" ("document") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "authtoken_token" ("key" varchar(40) NOT NULL PRIMARY KEY, "created" datetime NOT NULL, "user_id" varchar(12) NOT NULL UNIQUE REFERENCES "users_customuser" ("document") DEFERRABLE INITIALLY DEFERRED);
